(1, 'Higiene Hospitalar', 'higiene-hospitalar', '', '<img src="images/stories/example5.jpg" align="left" alt="image" border="0" /> A limpeza em hospitais, centro médico, laboratórios e afins vão muito além da necessidade de aparência de limpeza e a geRHação é uma das poucas empresas que dispõem de profissionais e know - how que estão aptos a desempenhar uma atividade altamente técnica e exigente como a área de saúde. Norteados por um sistema de padrão internacional de serviços que reúne maquinário, técnicas e treinamento humano. <br />Para integrar todos os seguimentos do mercado a  geRHação dispõem de profissionais de reconhecida experiência, seriedade e capacidade, que projetam de forma técnica e funcional os serviços a serem terceirizados, dando uma total segurança a empresas CONTRATANTE.', '', 1, 1, 0, 1, '2009-01-12 15:34:39', 62, '', '2009-03-26 11:26:38', 63, 0, '0000-00-00 00:00:00', '2009-01-12 15:34:39', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 4, 0, 5, '', '', 0, 2011, 'robots=\nauthor='),
(2, 'Terceirização de Serviços', 'terceirizacao-de-servicos', '', '<img border="0" align="left" src="images/stories/example4.jpg" alt="image" />O objetivo da geRHação é possibilitar aos clientes, maior e melhor desempenho em suas atividades globais de administração de recursos e serviços, agregando valores à suas estruturas de negócios e oferecendo-lhes soluções de serviços integrados para suas instalações, seus clientes, consumidores e funcionários. Entre alguns serviços, estão limpeza e conservação, copa, recepção, ascensoristas, zeladores, camareiras, manobristas, auxiliares, telefonistas, manutenção elétrica e hidráulica, manutenção de <br />áreas verdes(jardinagem), apoio à produção, portaria, auditoria, consultoria e outros. <br />Desta maneira, em sinergia, agrupando todos ou partes dos serviços periféricos em uma única empresa possibilita investimentos tecnológicos e humanos e conseqüentes reduções nos custos globais das empresas.', '', 1, 1, 0, 1, '2009-01-12 15:36:08', 62, '', '2009-04-24 11:49:16', 63, 0, '0000-00-00 00:00:00', '2009-01-12 15:36:08', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 3, 0, 4, '', '', 0, 926, 'robots=\nauthor='),
(3, 'Limpeza e Conservação', 'limpeza-e-conservacao', '', '<img border="0" align="left" src="images/stories/example1.jpg" alt="image" /> Indústrias, Escritórios, Hospitais, Escolas, Shoppings, Condomínios. Nossos profissionais estão totalmente preparados para a execução de serviços de limpeza e serviços complementares com padrão de qualidade nos serviços terceirizados. Todos eles passam por avaliação rigorosa e recebem treinamento especifico e comportamental, utilizamos máquinas e equipamento de ultima geração, manipulações de soluções químicas, coleta de lixo, além do uso correto de equipamentos para a própria proteção. <br />Proporciona comodidade, eficiência e ambientes saudáveis.', '', 1, 1, 0, 1, '2009-01-12 15:37:07', 62, '', '2009-04-24 11:48:58', 63, 0, '0000-00-00 00:00:00', '2009-01-12 15:37:07', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 3, 0, 2, '', '', 0, 1833, 'robots=\nauthor='),
(4, 'Portaria e Segurança', 'portaria-e-seguranca', '', '<p><img border="0" align="left" src="images/stories/example3.jpg" alt="image" /> È cada vez maior nossa preocupação com a segurança, e nos últimos tempos nós também temos que nos preocupar com quem nos presta esse serviço de “segurança” patrimonial. Foi pensando nisso que criamos o conceito de Agentes de Portaria que vão além do simples serviços de porteiros de condomínios e empresas, são profissionais rigorosamente selecionados e treinados para além das atividades comuns como controladores de acesso, recepção de documentos e pessoas, atuam também no apoio a segurança patrimonial por circuito de vídeo integrado, porem não armada e sem perder a cortesia e a amabilidade dos porteiros de outrora.<br />Sistema de circuito fechado de vídeo;<br />Melhor relação custo x benefício;<br />Supervisão volante constante;<br />Comunicação direta com a empresa.</p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>', '', 1, 1, 0, 1, '2009-01-12 15:40:56', 62, '', '2009-04-24 11:48:39', 63, 0, '0000-00-00 00:00:00', '2009-01-12 15:40:56', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 5, 0, 3, '', '', 0, 3109, 'robots=\nauthor='),
(5, 'Sistemas Corporativos', 'sistemas-corporativos', '', '<img border="0" align="left" src="images/stories/example6.jpg" alt="image" /><span style="font-family: arial,helvetica,sans-serif;">A geRHação disponibiliza aos seus clientes, projetos corporativos na área de serviços, oferecendo a CONTRATANTE, seguro e fiança, proporcionando uma total segurança aos seus clientes. <br />Para melhor controle dos serviços a geRHação colocará em cada localidade uma base operacional composto de uma encarregada, um supervisor e todo suporte operacional e administrativo, desenvolvendo assim, os serviços dentro dos projetos traçados na implantação dos serviços.</span>', '', 1, 1, 0, 1, '2009-01-12 15:42:29', 62, '', '2009-04-24 11:48:21', 63, 0, '0000-00-00 00:00:00', '2009-01-12 15:42:29', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 5, 0, 6, '', '', 0, 1757, 'robots=\nauthor='),
(6, 'A Empresa', 'a-empresa', '', '<p class="MsoNormal"><span style="line-height: 150%; font-family: ''Arial'',''sans-serif''; font-size: 10pt;">A <strong><span style="color: #000080;">ge<span style="color: #ff0000;">RH</span>ação</span></strong><span style="color: #0000ff;"> </span><span style="color: #000080;"><strong>Gestão de Recursos Humanos</strong></span> e Serviços terceirizados é resultado de mais de 30 anos de trabalho de seus fundadores como executivo de diversas empresas focadas na gestão de recursos humanos, estratégias corporativas na prestação de serviços terceirizados. O nascimento da <strong><span style="color: #000080;">ge<span style="color: #ff0000;">RH</span>ação</span></strong><span> </span>deve-se a grande necessidade do mercado em contratar empresas e profissionais capacitados e responsáveis para agregarem valores e prestarem serviços confiáveis e de qualidade. </span></p>\r\n<div style="text-align: justify;"><br /> \r\n<hr />\r\n</div>\r\n<div style="text-align: justify;">\r\n<hr />\r\n<strong><span style="color: #000080; font-size: 12pt;"><br /><span style="font-family: arial,helvetica,sans-serif; color: #000080;">ge<span style="color: #ff0000;">RH</span>ação implanta unidades em Blumenau/Gaspar - SC e Curitiba - PR.</span></span></strong><span style="font-size: 12pt;"><span style="color: #000000;"><br /><br /><span style="font-family: arial,helvetica,sans-serif; font-size: 10pt;">Visando um resultado ainda maior em agilidade e praticidade de atendimento aos nossos clientes, a <strong><span style="color: #000080;">ge</span><span style="color: #ff0000;">RH</span><span style="color: #000080;">ação Gestão de Recursos Humanos</span></strong> inaugurou filiais nas cidades de Blumenau - SC e também na cidade de Curitiba - PR, facilitando assim nosso atendimento aos clientes da região. A nova unidade da geRHação em Blumenau/Gaspar está localizada na Rodovia Governador Jorge Lacerda nº 4200 - Bairro Poço Grande e em Curitiba na rua Julio Cesar Ribeiro de Souza nº 339 - Bairro Hauer<strong><span style="font-size: 12pt;"><span style="color: #000080;"><br /></span></span></strong><br /><br /></span></span></span></div>\r\n<p> </p>', '', 1, 0, 0, 0, '2009-01-12 17:04:18', 62, '', '2016-09-12 13:41:27', 62, 0, '0000-00-00 00:00:00', '2009-01-12 17:04:18', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=0\nlink_section=0\nshow_category=0\nlink_category=\nshow_vote=0\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 18, 0, 14, '', '', 0, 59, 'robots=\nauthor='),
(7, 'A Empresa', 'a-empresa', '', '<p><a target="_blank" href="images/stories/sede.jpg"><img width="250" src="images/stories/sede_pq.jpg" alt="sede_pq" height="188" style="border-width: 0px; margin: 1px 4px 1px 0px; float: right;" /></a><a name="empresa"></a>A geRHação Gestão de Recursos Humanos e Serviços terceirizados é resultado de mais de 30 anos de trabalho de seus fundadores como executivo de diversas empresas focadas na gestão de recursos humanos, estratégias corporativas na prestação de serviços terceirizados. O nascimento da geRHação  deve-se a grande necessidade do mercado em contratar empresas e profissionais capacitados e responsáveis para agregarem valores e prestarem serviços confiáveis e de qualidade.</p>\r\n<h4><a name="visao"></a><span style="color: #02576b;"><strong>Visão</strong></span></h4>\r\n<p>Ser a melhor empresa na gestão de prestação de serviços terceirizados. Através da excelência na gestão das pessoas. Perpetuar a empresa de geração em geração.</p>\r\n<h4><a name="missao"></a><span style="color: #02576b;"><strong>Missão</strong></span></h4>\r\n<p>Nossa principal missão é realizar a satisfação de nossos clientes, colaboradores e parceiros, através de uma gestão empresarial fundamentada na ética e valores. Buscar excelência na área de serviços, através de tecnologia, treinamentos de capacitação técnica, valores éticos, motivacionais e acompanhamento de desempenho individual e em equipe.</p>\r\n<h4><a name="valores"></a><span style="color: #02576b;"><strong>Valores</strong></span></h4>\r\n<p>•    Eficiência<br />•    Agilidade<br />•    Responsabilidade<br />•    Valores humanos(valor da vida)<br />•    Respeito e simpatia<br />•    Amor<br /><br />Nossos colaboradores são  treinados pelos melhores profissionais da área a ser terceirizada, o departamento técnico/operacional desenvolve ,testa e acompanha todos os avanços nos produtos químicos e tecnologias, para estarmos sempre à frente no tempo, garantindo assim a nossos clientes, as melhores praticas e recursos, objetivando mais qualidade  e menos tempo empregado e consequentemente menores custos nos serviços.</p>', '', 1, 0, 0, 0, '2009-02-12 13:04:02', 62, '', '2009-02-26 20:25:47', 63, 0, '0000-00-00 00:00:00', '2009-02-12 13:04:02', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 11, 0, 13, '', '', 0, 4096, 'robots=\nauthor='),
(8, 'Serviços', 'servicos', '', '<h4><span style="color: #02576b;"><strong>Projetos de Terceirização</strong></span></h4>\r\n<p>Terceirização responsável, com parceria e comprometimento faz parte da missão de nossa empresa. <br />No mundo moderno e competitivo dos negócios a empresa deve focar a atenção em sua atividade fim, transferindo ao parceiro o desenvolvimento de atividades não essenciais.<br />Infelizmente grande maioria das empresas utiliza apenas o parâmetro preço para escolher seus parceiros.<br />De outro lado uma substancial parcela de prestadores de serviços, na busca desesperada por novos contratos, vende “preços baixos” no lugar de SOLUÇÕES.<br />Nesta situação muitas empresas acabam tendo problemas com a qualidade dos serviços e são surpreendidas com uma avalanche de ações trabalhistas que, a princípio, deveriam ser de responsabilidade da contratada para terceirização.<br />Muitas empresas estão percebendo que o importante é o binômio da prestação de bons serviços aliados a preços justos.<br />- Terceirização de pessoas<br />- Terceirização de serviços<br />Desenvolvemos projetos especiais de terceirização de serviços ou de profissionais de forma personalizada, sugerindo soluções objetivas utilizando nosso mix de produtos a fim de atender as suas necessidades específicas com segurança, agilidade e eficiência.</p>\r\n<h4><strong><span style="color: #02576b;">Terceirização de Serviços</span></strong></h4>\r\n<p>O objetivo da geRHação é possibilitar aos clientes, maior e melhor desempenho em suas atividades globais de administração de recursos e serviços, agregando valores à suas estruturas de negócios e oferecendo-lhes soluções de serviços integrados para suas instalações, seus clientes, consumidores e funcionários. Entre alguns serviços, estão limpeza e conservação, copa, recepção, ascensoristas, zeladores, camareiras, manobristas, auxiliares, telefonistas, manutenção elétrica e hidráulica, manutenção de <br />áreas verdes(jardinagem), apoio à produção, portaria, auditoria, consultoria e outros. <br />Desta maneira, em sinergia, agrupando todos ou partes dos serviços periféricos em uma única empresa possibilita investimentos tecnológicos e humanos e conseqüentes reduções nos custos globais das empresas.</p>\r\n<h4><strong><span style="color: #02576b;">Oferecemos os seguintes serviços profissionais:</span></strong></h4>\r\n<p>•    Limpeza e Conservação Industrial, Predial, Residencial e Comercial;<br />•    Limpeza em eventos;<br />•    Limpeza de Vidros;<br />•    Limpeza de Sinistros(inundações, incêndios e outros);<br />•    Impermeabilização de pisos;<br />•    Telefonistas, recepcionistas, secretárias, Office - boys e portarias industriais, comerciais e prediais; <br />•    Locação de mão de obra em geral;</p>\r\n<h4><strong><span style="color: #02576b;">Equipamentos</span></strong></h4>\r\n<p>A geRHação possui capacidade de aquisição dos mais variados modelos de equipamentos, dentro dos melhores padrões tecnológicos estabelecidos, causando uma redução considerada na mão de obra, conseqüentemente reduzindo custos, com tecnologia de ponta.</p>\r\n<table border="0">\r\n<tbody>\r\n<tr>\r\n<td><img width="128" src="images/stories/image013.jpg" alt="image013" height="96" /></td>\r\n<td><img width="108" src="images/stories/image012.jpg" alt="image012" height="108" /></td>\r\n<td><img width="156" src="images/stories/image011.jpg" alt="image011" height="108" /></td>\r\n<td><img width="172" src="images/stories/image016.jpg" alt="image016" height="156" /></td>\r\n</tr>\r\n<tr>\r\n<td><img width="100" src="images/stories/image014.jpg" alt="image014" height="237" /></td>\r\n<td colspan="3">\r\n<table border="0">\r\n<tbody>\r\n<tr>\r\n<td><img width="192" src="images/stories/image017.jpg" alt="image017" height="179" /></td>\r\n<td><img width="200" src="images/stories/image018.jpg" alt="image018" height="203" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan="4"><img width="320" src="images/stories/image015.jpg" alt="image015" height="240" /></td>\r\n</tr>\r\n</tbody>\r\n</table>', '', 1, 0, 0, 0, '2009-02-16 12:45:39', 62, '', '2009-08-13 12:43:37', 64, 0, '0000-00-00 00:00:00', '2009-02-16 12:45:39', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 11, 0, 12, '', '', 0, 298, 'robots=\nauthor='),
(10, 'Portaria e Segurança', 'portaria-e-seguranca', '', 'É cada vez maior nossa preocupação com a segurança, e nos últimos tempos nós também temos que nos preocupar com quem nos presta esse serviço de “segurança” patrimonial. Foi pensando nisso que criamos o conceito de Agentes de Portaria que vão além do simples serviços de porteiros de condomínios e empresas, são profissionais rigorosamente selecionados e treinados para além das atividades comuns como controladores de acesso, recepção de documentos e pessoas, atuam também no apoio a segurança patrimonial por circuito de vídeo integrado, porem não armada e sem perder a cortesia e a amabilidade dos porteiros de outrora.<br />Sistema de circuito fechado de vídeo;<br />Melhor relação custo x benefício;<br />Supervisão volante constante;<br />Comunicação direta com a empresa.', '', 1, 0, 0, 0, '2009-02-16 13:27:41', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2009-02-16 13:27:41', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 10, '', '', 0, 24, 'robots=\nauthor='),
(11, 'Serviços para Condomínios: Zeladores, Jardineiros, Recepcionistas', 'servicos-para-condominios-zeladores-jardineiros-recepcionistas', '', 'A terceirização de limpeza e demais serviços em condomínios comerciais e residenciais além de, verdadeiramente trazerem reduções de custos, ainda garantem a valorização e a longevidade do patrimônio.<br />A geRHação é especializada em serviços voltados para condomínios, onde os funcionários são rigorosamente treinados, a fim de garantir aos condôminos e visitantes ambientes saudáveis, limpos e uma equipe de profissionais motivados, deixando para trás todos os problemas do velho conceito de serviços e limpeza doméstica.', '', 1, 0, 0, 0, '2009-02-16 13:33:21', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2009-02-16 13:33:21', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 9, '', '', 0, 9, 'robots=\nauthor='),
(12, 'Higiene Hospitalar: Clínicas, Laboratórios, Ind. Farmacêuticas', 'higiene-hospitalar-clinicas-laboratorios-ind-farmaceuticas', '', 'A limpeza em hospitais, centro médico, laboratórios e afins vão muito além da necessidade de aparência de limpeza e a geRHação é uma das poucas empresas que dispõem de profissionais e know - how que estão aptos a desempenhar uma atividade altamente técnica e exigente como a área de saúde. Norteados por um sistema de padrão internacional de serviços que reúne maquinário, técnicas e treinamento humano.<br />Para integrar todos os seguimentos do mercado a  geRHação dispõem de profissionais de reconhecida experiência, seriedade e capacidade, que projetam de forma técnica e funcional os serviços a serem terceirizados, dando uma total segurança a empresas CONTRATANTE.', '', 1, 0, 0, 0, '2009-02-16 13:34:26', 62, '', '2009-03-26 11:21:25', 63, 0, '0000-00-00 00:00:00', '2009-02-16 13:34:26', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 6, 0, 8, '', '', 0, 13, 'robots=\nauthor='),
(13, 'Sistemas Corporativos', 'sistemas-corporativos', '', 'A geRHação disponibiliza aos seus clientes, projetos corporativos na área de serviços, oferecendo a CONTRATANTE, seguro e fiança, proporcionando uma total segurança aos seus clientes.<br />Para melhor controle dos serviços a geRHação colocará em cada localidade uma base operacional composto de uma encarregada, um supervisor e todo suporte operacional e administrativo, desenvolvendo assim, os serviços dentro dos projetos traçados na implantação dos serviços.', '', 1, 0, 0, 0, '2009-02-16 13:34:51', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2009-02-16 13:34:51', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 7, '', '', 0, 14, 'robots=\nauthor='),
(9, 'Limpeza e Conservação', 'limpeza-e-conservacao', '', 'Indústrias, Escritórios, Hospitais, Escolas, Shoppings, Condomínios. Nossos profissionais estão totalmente preparados para a execução de serviços de limpeza e serviços complementares com padrão de qualidade nos serviços terceirizados. Todos eles passam por avaliação rigorosa e recebem treinamento especifico e comportamental, utilizamos máquinas e equipamento de ultima geração, manipulações de soluções químicas, coleta de lixo, além do uso correto de equipamentos para a própria proteção.<br />Proporciona comodidade, eficiência e ambientes saudáveis.', '', 1, 0, 0, 0, '2009-02-16 13:21:46', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2009-02-16 13:21:46', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 11, '', '', 0, 14, 'robots=\nauthor='),
