(15, 'Confira a lista das 10 profissões mais promissoras da próxima década.', 'funcionarios-que-bajulam-chefes-prejudicam-empresas', '', '<h3>\r\n<h1><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;">\r\n<div><span style="font-size: 10pt; font-family: Arial;"><span style="font-size: 12pt; font-family: Times New Roman;">Investimentos maciços em <strong>energia limpa</strong> ao redor do mundo prometem garantir o futuro de profissionais como <strong>fazendeiros</strong>, <strong>empreendedores em tecnologias verdes e urbanistas,</strong> de acordo com a revista norte-americana <strong>Fast Company</strong>. Confira a lista das 10 profissões mais promissoras da próxima década.</span>\r\n<p>1) Fazendeiro - Como a agricultura sustentável requer pequena escala, produção local e métodos orgânicos, há uma enorme demanda por novos agricultores.</p>\r\n<p>2) Engenheiro florestal - O engenheiro florestal ajuda a população que vive em meio à mata a ter uma postura essencial para o meio ambiente nos dias de hoje: passar da degradação do verde à silvicultura, com a racionalização das atividades agrícolas na floresta.</p>\r\n<p>3) Instalador de painéis solares - Construir e instalar painéis de energia solar já responde por cerca de 770 mil empregos ao redor do mundo. E a recompensa é boa: o valor pago a um trabalhador como esse está entre US$ 15 e US$ 35 (R$ 33 a R$ 78) por hora. Somente nos Estados Unidos, esse setor emprega entre 25 mil e 35 mil trabalhadores - e a expectativa é que, até 2016, esse número salte para 110 mil.</p>\r\n<p>4) Construtor de prédios eficientes no uso de energia - Edifícios que seguem padrões internacionais de racionalização de energia, a exemplo do selo alemão ''Passivhaus'' e do suíço ''Minergie-P'' possibilitam, respectivamente, a economia de 75% e 95% em relação a um prédio tradicional. Transformar construções em projetos verdes necessitará não apenas de arquitetos e engenheiros, mas também de especialistas que usem técnicas específicas para racionalizar as fontes de energia.</p>\r\n<p>5) Fabricante de turbinas eólicas - O trabalho com energia eólica emprega, atualmente, cerca de 300 mil pessoas em todo o mundo. Noventa por cento da composição de uma turbina é metal, o que cria uma oportunidade para metalúrgicas se readaptarem ao novo mercado.</p>\r\n<p>6) Biológo, focado em conservação - A necessidade urgente de conservar os ecossistemas ao redor do planeta - e de quantificar o valor destes serviços - abre oportunidades para o ensino, a pesquisa e o trabalho de campo nas áreas públicas, privadas e em ONGs.</p>\r\n<p>7) Graduado em um ''MBA verde'' - O tripé pessoas-planeta-lucro sai da margem para o centro das decisões empresariais - daí a oportunidade para pesquisadores e consultores em iniciativas verdes, que foquem seus estudos nessa área.</p>\r\n<p>8) Reciclador - Embora o mercado para papel e plástico tenha diminuído, a demanda por aço segue aquecida - assim, a reciclagem continua como uma alternativa de ganhos.</p>\r\n<p>9) Desenvolvedor de sistemas, focado em sustentabilidade - A economia verde precisa de um núcleo de desenvolvedores de softwares especializados, que possam desenhar, construir e manter redes que deem apoio ao funcionamento de turbinas eólicas e outras soluções ecologicamente corretas.</p>\r\n<p>10) Urbanista - Encorajar o uso de bicicletas e desestimular a utilização de carros é apenas uma parte do trabalho - igualmente importantes são os planos para coleta de lixo e de contingência para inundações e ondas de calor. As vagas neste setor devem crescer 15% até 2016.</p>\r\n<p>Fonte Site da GLobo</p>\r\n</span></div>\r\n</span></h1>\r\n</h3>', '', 1, 2, 0, 2, '2009-02-16 14:25:12', 62, '', '2009-05-22 16:59:12', 63, 0, '0000-00-00 00:00:00', '2009-02-16 14:25:12', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 9, 0, 1, '', '', 0, 3, 'robots=\nauthor=');
