(16, 'Quer recolocar-se no mercado de trabalho? Motive-se', 'quer-recolocar-se-no-mercado-de-trabalho-motive-se', '', '<p>Vivemos em um mundo onde as demissões em massa estão tornando-se rotina. Em um mundo cada vez mais globalizado, estamos vendo constantemente fusões de empresas, aquisições de outras, fechamentos e perda de mercados, e também surgimento de novas empresas e possibilidades.</p>\r\n', '\r\n<p><br />Está comprovado que a demissão é um dos momentos mais difíceis na vida de um profissional. Ele sente esta perda muitas vezes, como se fosse a de uma pessoa querida da família, e costumeiramente entra até em depressão, sente-se desprestigiado, incompetente, acha que foi passado para traz, enfim, todos os sentimentos negativos que envolvem a situação.<br /><br />Bem, uma coisa é certa, não dá para ficar chorando pelos cantos o leite derramado. Claro que não vamos ser insanos e dizer que não causa dor, lógico que sim, mas não posso ficar a vida inteira nesta situação. Como sempre, é somente eu que decido o que quero fazer com o que estou passando, se vou encarar como uma derrota ou se vou pensar que pode ser uma grande oportunidade.<br /><br />Devemos entender primeiramente o que acontece com a maioria dos demitidos logo após a noticia. Segundo consultorias especializadas da área, enfrentamos algumas fases que vão, do momento fatal, até a superação. São elas:<br /><br />- Primeira, vem o sentimento de inconformidade e injustiça;<br />- Segunda, a pessoa começa a sentir raiva pela empresa e o chefe;<br />- Terceira, a insegurança, o medo, o que acontecerá daqui para frente;<br />- Quarta, vem a fase da reavaliação da vida e da carreira e tomar atitudes;<br />- Quinta, começa a percepção que pode haver boas possibilidades e oportunidades em outros locais;<br />- Sexta, já com a motivação e auto-estima em alta, começa a perceber que existe chances de sucesso.<br /><br />Agora com a auto-estima elevada e acreditando nas potencialidades, o mundo que antes era sombrio e sem chances, começa a se tornar ensolarado e com mais possibilidades. Afinal você vai ser um protagonista ou um coadjuvante deste momento?<br /><br />Perceba que agora você começa estar em vantagem sobre as demais pessoas, pois, não está mais preso a rotinas diárias, que antes o deixavam muito focado no que estava desenvolvendo e não enxergava o que passava ao seu redor. Portanto mãos a obra:<br /><br />- Já que você está mais aberto, analise e procure ver de fora o que ninguém está vendo, ou seja, as oportunidades que estão surgindo;<br />- Apareça, não se esconda, traga novas idéias e apresente para as pessoas. É o momento de usar sua criatividade, daqui a pouco alguém pode gostar;<br />- Prepare-se, não pare de estudar, diminua seus gastos em outras coisas, mas não deixe de investir em você;<br />- Identifique os seus pontos fracos e fortes, quais são os seus diferenciais e suas habilidades;<br />- Venda-se, você é o produto. Faça de você a melhor embalagem a mais bonita e atrativa para o mercado. Coloque-se na posição do cliente, o que ele está buscando;<br />- Procure pelas pessoas que você tem contato. Aproximadamente 70% das recolocações são feitas por indicação;<br />- Tenha persistência, não desista nos obstáculos que vão se apresentar;<br />- Não desperdice seu tempo, trabalhe duro, talvez mais do que antes, até conseguir seu objetivo;<br />- Analise todas as possibilidades, quem sabe não é hora de tocar um negócio seu. Perceba qual é o seu perfil;<br />- Não fique só, não deixe a tristeza abater seus sentimentos. Chame seus amigos, converse, sorria, divirta-se.<br /><br />Enfim, lembre-se sempre que nascemos para vencer, está escrito que todo ser humano veio para este mundo para realizar-se e está nas suas mãos fazer o melhor possível para que isto ocorra. Vá em busca do seu sucesso, mas não esqueça de se perguntar: O que é sucesso para você?</p>\r\n<p>Gilberto Wiesel<br /><span style="font-size: 10pt;"><a href="http://www.manager.com.br/reportagem/reportagem.php?id_reportagem=1822">http://www.manager.com.br/reportagem/reportagem.php?id_reportagem=1822</a></span></p>', 1, 2, 0, 2, '2009-02-16 14:42:01', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2009-02-16 14:42:01', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 3, '', '', 0, 7, 'robots=\nauthor='),
(17, 'Como desenvolver a resiliência', 'como-desenvolver-a-resiliencia', '', '<p>Segundo o professor de psicopatologia da Pontifícia Universidade Católica de São Paulo (PUC-SP) Haim Grunspun, um terço da população do mundo tem traços de resiliência. Para essas pessoas, trata-se de algo inato.</p>\r\n<p>Para os demais, é possível desenvolver a capacidade de se adaptar às mudanças no ambiente? Confira algumas ações que servem para treinar a resiliência:</p>\r\n', '\r\n<p>• Identifique o que causa estresse – Anote as experiências negativas e as positivas. Em pouco tempo, você será capaz de identificar as principais situações estressantes de sua vida. Quando se sabe quem é o inimigo, fica mais fácil lutar.<br /><br />• Reestruture as prioridades – Quando não é possível eliminar o fator estressante, passe a priorizar as atividades que dão prazer.<br /><br />• Dose as emoções – Ajuste a reação emocional ao estresse e tente usar saídas bem-humoradas sempre que possível. Elas amenizam a raiva e ainda o transformam numa pessoa espirituosa.<br /><br />• Use técnicas de relaxamento – Respirar fundo aumenta a oxigenação do cérebro e reduz os batimentos cardíacos. Inspire e expire lenta e profundamente pelo nariz, enquanto conta até dez. Repita o exercício sentir-se aliviado.<br /><br />• Peça ajuda – E aceite-a. A maioria dos resilientes possui muitos amigos. A chance de dar conta de um problema é bem maior quando você se sente apoiado.</p>\r\n<p>Andreza Emília Marino<br /><span style="font-size: 10pt;"><a href="http://empregos.ig.com.br/carreira/noticias/2009/02/13/como+desenvolver+a+resiliencia+4048919.html">http://empregos.ig.com.br/carreira/noticias/2009/02/13/como+desenvolver+a+resiliencia+4048919.html</a></span></p>', 1, 2, 0, 2, '2009-02-16 14:44:44', 62, '', '2009-02-16 14:47:01', 62, 0, '0000-00-00 00:00:00', '2009-02-16 14:44:44', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 2, 0, 2, '', '', 0, 9, 'robots=\nauthor='),
