ransparent; border: #f0f0f0; padding: 0.75pt;">\r\n<p class="MsoNormal"><span style="font-size: 10pt; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: PT-BR; mso-bidi-font-family: Arial;"><span style="color: #000000;"><span style="font-family: Calibri;">Perto está o SENHOR de todos os que o invocam, de todos os que o invocam em verdade.</span></span></span></p>\r\n</td>\r\n</tr>\r\n<tr style="mso-yfti-irow: 1;">\r\n<td style="background-color: transparent; border: #f0f0f0; padding: 0.75pt;">\r\n<p class="MsoNormal"><span style="font-size: 10pt; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: PT-BR; mso-bidi-font-family: Arial;"><span style="color: #000000;"><span style="font-family: Calibri;">19 </span></span></span></p>\r\n</td>\r\n<td style="background-color: transparent; border: #f0f0f0; padding: 0.75pt;">\r\n<p class="MsoNormal"><span style="font-size: 10pt; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: PT-BR; mso-bidi-font-family: Arial;"><span style="color: #000000;"><span style="font-family: Calibri;">Ele cumprirá o desejo dos que o temem; ouvirá o seu clamor, e os salvará.</span></span></span></p>\r\n</td>\r\n</tr>\r\n<tr style="mso-yfti-irow: 2;">\r\n<td style="background-color: transparent; border: #f0f0f0; padding: 0.75pt;">\r\n<p class="MsoNormal"><span style="font-size: 10pt; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: PT-BR; mso-bidi-font-family: Arial;"><span style="color: #000000;"><span style="font-family: Calibri;">20 </span></span></span></p>\r\n</td>\r\n<td style="background-color: transparent; border: #f0f0f0; padding: 0.75pt;">\r\n<p class="MsoNormal"><span style="font-size: 10pt; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: PT-BR; mso-bidi-font-family: Arial;"><span style="color: #000000;"><span style="font-family: Calibri;">O SENHOR guarda a todos os que o amam; mas todos os ímpios serão destruídos.</span></span></span></p>\r\n</td>\r\n</tr>\r\n<tr style="mso-yfti-irow: 3; mso-yfti-lastrow: yes;">\r\n<td style="background-color: transparent; border: #f0f0f0; padding: 0.75pt;">\r\n<p class="MsoNormal"><span style="font-size: 10pt; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: PT-BR; mso-bidi-font-family: Arial;"><span style="color: #000000;"><span style="font-family: Calibri;">21 </span></span></span></p>\r\n</td>\r\n<td style="background-color: transparent; border: #f0f0f0; padding: 0.75pt;">\r\n<p class="MsoNormal"><span style="font-size: 10pt; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: PT-BR; mso-bidi-font-family: Arial;"><span style="color: #000000;"><span style="font-family: Calibri;">A minha boca falará o louvor do SENHOR, e toda a carne louvará o seu santo nome pelos séculos dos séculos e para sempre.</span></span></span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class="MsoNormal"><strong><span style="font-size: 12pt; color: #000000; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: PT-BR; mso-bidi-font-family: ''Times New Roman'';">\r\n<p class="MsoNormal"><span style="font-size: 12pt; color: #000000; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: PT-BR; mso-bidi-font-family: ''Times New Roman'';"><span style="font-size: 12pt; color: #000000; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: PT-BR; mso-bidi-font-family: ''Times New Roman'';"><span style="font-size: 12pt; color: #000000; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: PT-BR; mso-bidi-font-family: ''Times New Roman'';"><span style="font-size: 12pt; color: #000000; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: PT-BR; mso-bidi-font-family: ''Times New Roman'';"><span style="font-size: 12pt; font-family: Times New Roman'',''serif; mso-fareast-font-family: ''Times New Roman''; mso-fareast-language: PT-BR;"><span style="font-size: 12pt; font-family: Times New Roman'',''serif; m