 </p>\r\n</span><span><span style="font-size: 10pt; line-height: 115%;"><span>\r\n<p class="MsoNormal"> </p>\r\n</span></span><span style="font-size: 18pt;"><span style="text-decoration: underline;"><em>\r\n<p class="MsoNormal"> </p>\r\n<table border="0" cellpadding="0" cellspacing="0" style="border-collapse: collapse; mso-yfti-tbllook: 1184;" class="MsoNormalTable">\r\n<tbody>\r\n</tbody>\r\n</table>\r\n<p class="MsoNormal">\r\n<table border="0" cellpadding="0" cellspacing="0" style="border-collapse: collapse; mso-yfti-tbllook: 1184;" class="MsoNormalTable">\r\n</table>\r\n</p>\r\n<p class="MsoNormal"><span style="font-size: 10pt; line-height: 115%;"><br /><span style="font-family: Calibri;">Às vezes, os nossos fardos parecem mais pesados do que podemos suportar; e perguntamo-nos como podemos prosseguir. Quando Davi estava só em uma encruzilhada na estrada da vida, lembrou-se que o Senhor é aquele que ajuda o ser humano a carregar os seus fardos. Se você estiver curvado pelo peso de um fardo e sentindo que está prestes a cair, volte-se para Deus, peça-lhe ajuda! Ele está pronto para levantá-lo e ajudá-lo a carregar o seu fardo </span></span></p>\r\n<p class="MsoNormal"> </p>\r\n<table border="0" cellpadding="0" cellspacing="0" style="border-collapse: collapse; mso-yfti-tbllook: 1184;" class="MsoNormalTable">\r\n</table>\r\n</em></span></span></span></span></span></strong></p>\r\n</span></strong></p>\r\n</span></strong></p>\r\n</span></span></strong></p>\r\n</span></span></span></strong></p>\r\n</span></strong></p>\r\n</span></strong></p>\r\n</span></strong></p>\r\n</span></strong></p>\r\n</span></span></strong></p>\r\n</span></span></strong></p>\r\n</span></span></strong></p>\r\n</span></strong></span></span></span></p>\r\n</strong></span></span></strong></span></span></strong></span></span></span></strong></span></strong></span></span></span></strong></p>\r\n</span></strong></p>\r\n</span></strong></p>\r\n</span></strong></p>\r\n</span></strong></p>\r\n</span></p>