(26, 'Meditação Diária', 'meditacao-diaria', '', '<div><span style="color: navy;"><span style="font-family: Tahoma;"><strong> </strong></span></span><span style="color: navy;"><span style="font-family: Tahoma;"></span></span>\r\n<div style="text-align: left;"></div>\r\n<div></div>\r\n</div>\r\n<div style="text-align: center;"></div>\r\n<div dir="ltr" style="text-align: center;">\r\n<div style="text-align: left;"><span style="color: #000080;"><strong>A passagem bíblica da meditação de hoje encontra-se no livro de: <span style="color: #ff0000;">2Coríntios 5-17</span> (Versão Bíblia Viva)</strong></span><br /></div>\r\n<div style="text-align: justify;"><span style="color: #000080;"><em><span style="color: #000000;"> </span></em></span><br /><span style="color: #000080;"><em><span style="color: #000000;">“Podem estar seguros de que, quanto mais suportarmos sofrimento por causa de Cristo, mais Ele derramara sobre nós o seu consolo e o seu incentivo. Nós estamos em sérios apertos por leva-lhes o consolo e a salvação de Deus. Mas em nossa dificuldade Deus nos tem confortado - e isto, também, para ajudar vocês; para mostrar-lhes com a nossa experiência pessoal como Deus nos confortara ternamente quando vocês suportarem estes mesmos sofrimentos. Ele lhes dará a força para agüentar. Eu acho que vocês devem saber, amados irmãos, que tempos difíceis nós atravessamos na Ásia. Fomos realmente esmagados e oprimidos, e tivemos medo de não conseguir sobreviver. Sentimos que estávamos condenados a morte e percebemos como éramos fracos demais para socorrer-nos a nós mesmos; isso, porém, foi bom, porque assim nós colocamos tudo nas mãos de Deus, o Único que poderia salvar-nos, pois é capaz até de levantar os mortos. E Ele nos ajudou mesmo, e nos salvou de uma morte terrível; sim, e esperamos que Ele faça assim sempre. Mas vocês, também precisam ajudar-nos, orando por nós. Muita gratidão e louvor serão oferecidos a Deus por vocês, que vêem suas portentosas respostas as orações feitas a favor da nossa segurança! Estamos tão satisfeitos que podemos dizer, com toda a franqueza, que em toda a nossa conduta temos sido puros e sinceros confiando calmamente na ajuda do Senhor, e não na nossa própria capacidade. E isso é mais verdadeiro ainda, se possível, quanto ao modo pelo qual temos agido em relação a vocês. Minhas cartas têm sido francas e sinceras; e não têm nada nas entrelinhas! E já que, mesmo assim, vocês ainda não me conhecem bem (espero que um dia vocês conhecerão) eu quero que procurem aceitar-me e orgulhar-se de mim, como até certo ponto já o têm feito; tal como eu me orgulharei de vocês naquele dia quando nosso Senhor Jesus voltar. Em vista de estar tão certo da compreensão e da confiança de vocês foi que planejei deter-me e vê-los em minha viagem para a Macedônia, assim como depois quando voltei, afim de que eu pudesse ser uma dupla bênção para vocês, de modo que pudessem encaminhar-me na minha jornada para a Judéia. Então, poderão estar indagando vocês, por que mudei de plano? Será que eu realmente ainda não me decidira? Ou serei eu como um homem do mundo, que diz "sim", quando na realidade quer dizer "não"?”</span></em></span><br /></div>\r\n<span style="color: #000080;"><strong><br /></strong></span>\r\n<div style="text-align: justify;"><span style="color: #000000;"><strong><span>“Quando a vi pela primeira vez, na casa onde estudávamos a Bíblia, ela estava muito triste. Vivia com seus dois filhos pequenos, pois o marido fugira para levar uma vida totalmente dominada por suas paixões. Esforçada, diariamente deixava as crianças com uma amiga e ia ao trabalho. Sua vida era difícil e desanimadora. Muitas vezes trabalhava chorando. Conheceu outro homem que prometeu dar-lhe a felicidade que tanto almejava, mas tiveram mais dois filhos e ele também a deixou. Tal felicidade era uma ilusão! Naquele dia, quando a jovem senhora contava sua experiência de vida, eu lhe disse: “Você gostaria de conhecer alguém que pode ajuda-la? Venha conhecer Jesus!” Ela ouviu a mensagem de salvação e em pouco tempo a leitura da Bíblia e a oração tornaram-se parte de sua vida. Depois começou a ir à igreja com seus quatro filhos. Passamos a pedir a Deus que trouxesse o seu marido de volta. Numa sexta-feira à noite, após a reunião de oração, um homem que eu nunca tinha visto antes bateu à porta de meu gabinete. Ele disse que era o marido daquela senhora, e continuou: “Quero conhecer o Jesus que minha ex-mulher conhece. Só Jesus pode me ajudar a deixar esta vida de lama na qual estou. E depois de conhecer a Jesus, eu quero voltar para a minha mulher”. Tive o privilégio de ajudar aquela família a encontrar Jesus, que deu um novo significado às suas vidas. Foi assim também com Onésimo, sobre o qual lemos hoje. Era um escravo fugitivo quando conheceu Jesus, e passou a ser útil (o significado de seu nome, que só fez sentido após sua conversão). Paulo, então, recomenda a Filemom, dono de Onésimo, a recebê-lo como irmão, pois sua vida fora transformada. Se você é cristão, sua tarefa é dizer a todos que, apesar de tribulações, pecados, lutas e desilusões, Jesus valoriza a todos e dá a oportunidade de começar tudo de novo.</span></strong></span><br /></div>\r\n<span style="color: #000080;"><strong><br />Jesus dá um novo significado à vida de quem o segue.<br /> <br />Tenha um final de semana abençoado por Deus!</strong></span><span style="color: #000080;"><strong><br /></strong></span><span style="color: #000080;"><strong></strong></span></div>\r\n<div style="text-align: center;"><span style="font-size: 12pt; font-family: times new roman,times;"><strong><span style="color: #000080;">Faça sua pesquisa bíblica <a href="http://www.bibliaonline.com.br/">clicando aqui.</a></span></strong></span></div>\r\n<div style="text-align: center;"><br /></div>\r\n<div style="text-align: center;"><br /></div>\r\n<div style="text-align: center;"><strong><span style="color: #000080;"><b><span style="color: #000080;"><b><span style="color: #000080;"><b><span style="color: #000080;"><b><span style="color: #000080;"><b><span style="color: #000080;"><b><span style="color: #000080;"><b><span style="color: #000080;"><b><span style="color: #000080;"><b><span style="color: #000080;"><b><span style="color: #000080;"></span></strong></span></b></span></b></span><strong></strong></b></span><strong></strong></b></span></b><strong></strong></span></b></span><strong></strong></b></span><strong></strong><strong></strong></b></span></b></span><strong></strong></b><strong></strong></div>', '', 1, 0, 0, 0, '2010-07-02 03:00:00', 62, '', '2010-07-02 11:20:24', 63, 0, '0000-00-00 00:00:00', '2010-07-02 03:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 319, 0, 2, '', '', 0, 4242, 'robots=\nauthor='),
(27, 'gresgrew', 'gresgrew', '', 'frewfewfwffew', '', -2, 0, 0, 0, '2009-06-09 19:29:49', 62, '', '2009-06-16 15:59:51', 62, 0, '0000-00-00 00:00:00', '2009-06-09 19:29:49', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 5, 0, 0, '', '', 0, 1, 'robots=\nauthor='),
(28, 'Vagas Disponiveis', 'vagas-disponiveis', '', '<p><span style="color: #000080; font-size: 14pt;"><strong><em><span style="text-decoration: underline;">Confira Abaixo nossas vagas e cadastre seu Currículo.</span></em></strong></span><br /><br /><span style="color: #800000; font-size: 18pt;"><strong>Joinville e Região </strong></span></p>\r\n<p><br /><strong>Analista de Vendas –</strong> Superior completo ou cursando. Conhecimentos em atendimento direto a clientes, criação de gráficos, impostos e cálculos de juros simples e compostos. \r\n<hr />\r\n<strong>Auxiliar de Produção –</strong> Ensino fundamental completo. Residir em Pirabeiraba. \r\n<hr />\r\n<strong>Auxiliar de Produção –</strong> Ensino médio completo. Conhecimentos em metrologia e instrumentos de medição. \r\n<hr />\r\n<strong>Costureira –</strong> Com conhecimento em maquina overlok, reta e duas agulhas. \r\n<hr />\r\n<strong>Cozinheira –</strong> Ensino Médio Completo. Para trabalhar em Hospital. \r\n<hr />\r\n<strong>Escriturário -</strong> Técnico em Contabilidade ou cursando o primeiro ano de contabilidade. Conhecimentos em entrada de notas fiscais, tributos fiscais, retenção de imposto, trabalhará com toda mercadoria que entra.  \r\n<hr />\r\n<strong>Mestre de Obras-</strong> conhecimentos na função, na execução de obras e edifícios. \r\n<hr />\r\n<strong>Operador de Extrusora -</strong> Ensino Médio Completo ter trabalhado no segmento de plásticos, conhecimento em extrusão/granuladora/ Injetora/Sopro. \r\n<hr />\r\n<strong>Professor de Inglês –</strong> Formação Superior Completo. Ter conhecimentos na área. \r\n<hr />\r\n<strong>Supervisora de Limpeza -</strong> amplo conhecimento na área de limpeza e na gestão de pessoas. \r\n<hr />\r\n<strong>Zeladora –</strong> ter trabalhado na área. \r\n<hr />\r\n</p>\r\n<p>Para vagas de Joinville e região envie seu currículo <a href="http://www.informatechsistemas.com.br/goc/login">clicando aqui.</a></p>\r\n<hr />\r\n<p><span style="color: #800000; font-size: 18pt;"><strong><span style="text-decoration: underline;">Blumenau e Região<br /></span></strong></span><br />Auxiliar de Serviços Gerais.</p>\r\n<hr />\r\nJardineiro \r\n<hr />\r\nLider de Equipe de Limpeza \r\n<hr />\r\nZeladora – Limpeza Geral. \r\n<hr />\r\n<br />Para vagas de Blumenau e região envie seu currículo <a href="http://www.informatechsistemas.com.br/goc/login">clicando aqui.</a>\r\n<p> </p>\r\n<p> </p>', '', 1, 0, 0, 0, '2009-09-23 03:00:00', 62, '', '2009-09-30 20:10:26', 63, 63, '2010-05-10 12:01:09', '2009-09-23 03:00:00', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 50, 0, 1, '', '', 0, 6873, 'robots=\nauthor='),
(29, 'Recrutamento e Seleção', 'recrutamento-e-selecao', '', '<img src="images/stories/recrutamento.png" align="left" border="0" hspace="6" />A <span style="color: #0000ff;">ge</span><span style="color: #ff0000;">RH</span><span style="color: #0000ff;">ação</span> atende e assessora empresas na seleção de profissionais dos mais diversos níveis e atividades. Nosso serviço é sempre com agilidade, assertividade, confiabilidade  e segurança da melhor contratação. Tem como objetivo identificar e selecionar profissionais adequados a necessidade de nossos clientes. Tudo à sua disposição, para selecionar o melhor profissional para sua empresa.<br />Desenvolvemos um trabalho personalizado, em conjunto com nosso cliente, baseado nos desafios e objetivos da posição, no segmento, porte e posicionamento no mercado, cultura e valores da empresa.  Definimos o perfil e as competências que deveremos buscar no profissional.<br />', '', 1, 1, 0, 1, '2009-08-07 17:39:21', 62, '', '2009-08-10 12:41:33', 62, 0, '0000-00-00 00:00:00', '2009-08-07 17:39:21', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 5, 0, 1, '', '', 0, 3325, 'robots=\nauthor=');
