(2, 'CentroSul', 'centro-sul', 'http://www.centrosul.net/', 'Av. Gustavo Richard, s/n', '88010-290', 'Florianópolis', 'Santa Catarina', 'BR', '<br />Localizado no Centro de Florianópolis, o CentroSul está situado às margens da Baía Sul, a poucos metros das pontes que ligam as áreas continental e insular da cidade e a 13 km do Aeroporto Internacional Hercílio Luz. <br /><br />Com 15.000m², o Centro de Convenções de Florianópolis - CentroSul foi construído dentro da mais moderna técnica de espaços flexíveis e multifuncionais do mercado. Sua infra-estrutura tecnológica é inteligente: pode receber desde uma pequena reunião de trabalho até shows para 17 mil pessoas. A divisão interna de ambientes permite a realização de vários eventos simultâneos, sem que um interfira no outro. <br /><br />Em seus dois andares encontram-se salões, restaurante, lanchonete, fáceis acessos aos banheiros, amplo estacionamento para 1.000 carros e redes elétricas, telefônicas e hidráulicas embutidas no piso, facilitando o trabalho em qualquer ponto dos salões. <br /><br />A estrutura moderna também garante uma maior praticidade e ainda conta com docas para carga e descarga.<br /><br /><strong>Prêmios</strong><br /><br /><img src="http://www.centrosul.net/imagens/seta.gif" width="10" height="10" />2000 / 2001 / 2003 / 2006 Jacaré de Ouro<br /> Prêmio como Melhor Centro de Convenções do Brasil; <br /><br /><img src="http://www.centrosul.net/imagens/seta.gif" width="10" height="10" />2002 / 2004 Jacaré de Prata<br /> Prêmio como Segundo Melhor Centro de Convenções; <br /><br /><img src="http://www.centrosul.net/imagens/seta.gif" width="10" height="10" />2003 Top de Marketing da ADVB.', 'Centro-Sul, Florianópolis', '', 'ctro3x_1234964112.jpg', 1, 62, '201.67.161.135', '2009-02-18 13:36:14', '2009-02-18 13:41:50', 62, 1, 0, '0000-00-00 00:00:00', 2);
