(31, 0, 'Treinamento Liderança geRHação 16/01/2010', '', 'treinamento-liderana-gerhao-16-01-2010', '', '', 'left', '<p>No dia 16 de Janeiro de 2010 foi realizado na sede da geRHação em Joinville o quarto Seminário para Liderança, na ocasião o Diretor da geRHação Sr. Hilário Frainer apresentou uma palestra motivacional, apresentando os projetos para 2010, também foram esclarecidos alguns assuntos referentes a Recursos Humanos, Supervisão e Suprimentos.</p>', '2010-01-18 13:29:02', 1, 0, '0000-00-00 00:00:00', NULL, 21, 0, 0, 433, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(32, 0, 'Treinamento Autopista Palhoça', '', 'treinamento-autopista-palhoa', '', '', 'left', '<p style="text-align: justify;">No dia 19 de Janeiro de 2010 foi realizado na Praça de Pedágio de Palhoça o treinamento Técnico/Motivacional, na ocasião o Supervisor da geRHação Sr. Eder Juliano Machado apresentou uma palestra motivacional, apresentando os Métodos de Limpeza, uso de novos produtos adquiridos, os colaboradores também foram instruidos a trabalharem em Equipe, de forma a melhorar os processos de limpeza.</p>', '2010-01-21 12:00:48', 1, 0, '0000-00-00 00:00:00', NULL, 19, 0, 0, 555, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(33, 0, 'Treinamento Vigias - Comdomínio Patio das Artes.', '', 'treinamento-vigias-comdomnio-patio-das-artes.', '', '', 'left', '<p>No dia 20 de Janeiro de 2010 foi realizado na sede da geRHação em Joinville o Treinamento Técnicas de Vigilância, na ocasião o Gerente da geRHação Sr. Valdecir Francisco Leite apresentou uma palestra sobre Técnicas de Vigilância, apresentando os pontos fundamentais para o zelo e guarda do Patrimônio a ser Vigiado, também foram esclarecidos alguns assuntos referentes a Recursos Humanos.</p>', '2010-01-21 12:07:06', 1, 0, '0000-00-00 00:00:00', NULL, 17, 0, 0, 788, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(34, 0, 'Treinamento Cremer  / Blumenau', '', 'treinamento-cremer-blumenau', '', '', 'left', '<p>No dia 18 de Janeiro de 2010 foi realizado na sede Cremer em Blumenau o Treinamento Técnico / Motivacional, na ocasião o Diretor da geRHação Sr. Hilário Frainer apresentou uma palestra sobre Trabalho em Equipe, também foi apresentado a Visão, Missão e Valores da geRHação e sorteado brindes aos colaboradores.</p>', '2010-01-21 13:53:19', 1, 0, '0000-00-00 00:00:00', NULL, 20, 0, 0, 506, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(35, 0, 'Treinamento Bunge Administrativo 10.02.2010', '', 'treinamento-bunge-administrativo-10.02.2010', '', '', 'left', '<p style="text-align: justify;">No dia 10 de Fevereiro de 2010 foi realizado na Bunge Alimentos em Gaspar - SC o Treinamento Técnico Motivacional, na ocasião o Supervisor da geRHação Sr. Eder Juliano Machado apresentou uma palestra sobre Trabalho em Equipe, também foi repassado aos colaboradores a Visão, Missão e Valores da geRHação, na ocasião foram apresentados os aniversariantes do mês.</p>', '2010-02-11 13:13:39', 1, 0, '0000-00-00 00:00:00', NULL, 18, 0, 0, 739, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(36, 0, 'Treinamento Sociesc Florianópolis 02.03.2010', '', 'treinamento-sociesc-florianpolis-02.03.2010', '', '', 'left', '<p style="text-align: justify;">No dia 02 de março de 2010 foi realizado na Sociesc - Unica em Florianópolis - SC o Treinamento Técnico Motivacional, na ocasião o Supervisor da geRHação Sr. Eder Juliano Machado apresentou a palestra motivacional O Segredo do Sucesso, também foi repassado aos colaboradores a Visão, Missão e Valores da geRHação, na ocasião as mulheres presentes foram presenteadas e parabenizadas pelo Dia Internacional da Mulher.</p>', '2010-05-26 12:41:04', 1, 0, '0000-00-00 00:00:00', NULL, 16, 0, 0, 137, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(37, 0, 'Treinamento Busscar Onibus 24/03/2010', '', 'treinamento-busscar-onibus-24-03-2010', '', '', 'left', '<p style="text-align: justify;">No dia 24 de março de 2010 foi realizado na Busscar Onibus em Joinville - SC o Treinamento Técnico Motivacional, na ocasião o Supervisor da geRHação Sr. Eder Juliano Machado apresentou a palestra motivacional O Segredo do Sucesso, também foi repassado aos colaboradores a Visão, Missão e Valores da geRHação.</p>', '2010-05-26 12:50:53', 1, 0, '0000-00-00 00:00:00', NULL, 15, 0, 0, 188, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(38, 0, 'Treinamento Cremer 13/04/2010', '', 'treinamento-cremer-13-04-2010', '', '', 'left', '<p style="text-align: justify;">No dia 13 de Abril de 2010 foi realizado na sede da Cremer em Blumenau - SC o Treinamento Técnico Motivacional, na ocasião o Supervisor da geRHação Sr. Eder Juliano Machado apresentou a palestra motivacional O Segredo do Sucesso, também foi repassado aos colaboradores a Visão, Missão e Valores da geRHação.</p>', '2010-05-26 12:53:48', 1, 0, '0000-00-00 00:00:00', NULL, 14, 0, 0, 164, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(39, 0, 'Treinamento Bunge Administrativo 14/04/2010', '', 'treinamento-bunge-administrativo-14-04-2010', '', '', 'left', '<p style="text-align: justify;">No dia 14 de Abril de 2010 foi realizado na Bunge Alimentos em Gaspar - SC o Treinamento Técnico Motivacional para a equipe de limpeza administrativa, na ocasião o Supervisor da geRHação Sr. Eder Juliano Machado apresentou a palestra motivacional O Segredo do Sucesso, também foi repassado aos colaboradores a Visão, Missão e Valores da geRHação.</p>', '2010-05-26 12:55:48', 1, 0, '0000-00-00 00:00:00', NULL, 13, 0, 0, 170, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(40, 0, 'Treinamento Bunge Fábrica 20/04/2010', '', 'treinamento-bunge-fbrica-20-04-2010', '', '', 'left', '<p style="text-align: justify;">No dia 20 de Abril de 2010 foi realizado na Bunge Alimentos em Gaspar - SC o Treinamento Técnico Motivacional para a equipe que presta serviços na Fabrica, na ocasião o Supervisor da geRHação Sr. Eder Juliano Machado apresentou a palestra motivacional O Segredo do Sucesso, também foi repassado aos colaboradores a Visão, Missão e Valores da geRHação.</p>', '2010-05-26 13:04:02', 1, 0, '0000-00-00 00:00:00', NULL, 11, 0, 0, 165, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(41, 0, 'Treinamento Provinil/Nicoll 23/04/2010', '', 'treinamento-provinil-nicoll-23-04-2010', '', '', 'left', '<p style="text-align: justify;">No dia 23 de Abril de 2010 foi realizado na Próvinil/Nicoll em São José dos Pinhais - PR o Treinamento Técnico Motivacional para a equipe de limpeza administrativa, na ocasião o Diretor da geRHação Sr. Hilário Frainer apresentou uma palestra motivacional, também foi repassado aos colaboradores a Visão, Missão e Valores da geRHação.</p>', '2010-05-26 13:06:41', 1, 0, '0000-00-00 00:00:00', NULL, 12, 0, 0, 170, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(42, 0, 'Treinamento Bematech 30/04/2010', '', 'treinamento-bematech-30-04-2010', '', '', 'left', '<p style="text-align: justify;">No dia 30 de Abril de 2010 foi realizado na Sede da Bematech em Curitiba - PR o Treinamento Técnico Motivacional para a equipe de limpeza administrativa, na ocasião o Diretor da geRHação Sr. Hilário Frainer apresentou uma palestra motivacional, também foi repassado aos colaboradores a Visão, Missão e Valores da geRHação.</p>', '2010-05-26 13:08:29', 1, 0, '0000-00-00 00:00:00', NULL, 10, 0, 0, 200, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(43, 0, 'Treinamento Liderança geRHação 07/05/2010', '', 'treinamento-liderana-gerhao-07-05-2010', '', '', 'left', '<p>No dia 07 de Março de 2010 foi realizado na sede da geRHação em Joinville o quinto Seminário para Liderança, na ocasião o Diretor da geRHação Sr. Hilário Frainer apresentou uma palestra motivacional, também foram esclarecidos alguns assuntos referentes a Recursos Humanos, Supervisão e Suprimentos.</p>\r\n<p> </p>', '2010-05-26 13:15:25', 1, 0, '0000-00-00 00:00:00', NULL, 9, 0, 0, 228, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(44, 0, 'Treinamento Sociesc Curitiba 28/05/2010', '', 'treinamento-sociesc-curitiba-28-05-2010', '', '', 'left', '<p style="text-align: justify;">No dia 28 de Maio de 2010 foi realizado na Sociesc em Curitiba - PR o Treinamento Técnico Motivacional para a equipe de limpeza, na ocasião o Diretor da geRHação Sr. Hilário Frainer apresentou uma palestra motivacional, também foi repassado aos colaboradores a Visão, Missão e Valores da geRHação.</p>', '2010-06-02 12:34:38', 1, 0, '0000-00-00 00:00:00', NULL, 8, 0, 0, 133, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(45, 0, 'Treinamento Bunge - Gaspar 08/06/2010', '', 'treinamento-bunge-gaspar-08-06-2010', '', '', 'left', '<p style="text-align: justify;">No dia 08 de Junho de 2010 foi realizado na Bunge em Gaspar - SC o Treinamento Técnico Motivacional para a equipe de limpeza, na ocasião o Diretor da geRHação Sr. Hilário Frainer apresentou uma palestra motivacional, também foi repassado aos colaboradores a Visão, Missão e Valores da geRHação, efetuada a distribuição de brindes e homenageados os aniversariantes do periodo.</p>\r\n<p> </p>', '2010-06-11 13:14:52', 1, 0, '0000-00-00 00:00:00', NULL, 7, 0, 0, 88, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(46, 0, 'Treinamento Auto Pista Garuva - 11/06/2010', '', 'treinamento-auto-pista-garuva-11-06-2010', '', '', 'left', '<p style="text-align: justify;">No dia 11 de Junho de 2010 foi realizado na Praça de  Pedágio de Garuva - SC o Treinamento Técnico Motivacional, na ocasião o Supervisor da geRHação Sr. Eder Juliano Machado apresentou uma palestra motivacional, também foi repassado aos colaboradores a Visão, Missão e Valores da geRHação.</p>', '2010-06-23 18:25:14', 1, 0, '0000-00-00 00:00:00', NULL, 6, 0, 0, 35, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(47, 0, ' Treinamento Auto Pista Araquari - 16/06/2010 (1)', '', 'treinamento-auto-pista-araquari-16-06-2010-1', '', '', 'left', 'No dia 16 de Junho de 2010 foi realizado na Praça de  Pedágio de Araquari - SC o Treinamento Técnico Motivacional, na ocasião o Supervisor  da geRHação Sr. Eder Juliano Machado apresentou uma palestra  motivacional, também foi repassado aos colaboradores a Visão, Missão e  Valores da geRHação.', '2010-06-23 18:51:17', 1, 0, '0000-00-00 00:00:00', NULL, 5, 0, 0, 34, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(48, 0, 'Treinamento Bunge - Gaspar 17/06/2010', '', 'treinamento-bunge-gaspar-17-06-2010', '', '', 'left', '<div style="text-align: justify;">No dia 17  de Junho de 2010 foi realizado na Bunge em Gaspar - SC o Treinamento  Técnico Motivacional para a equipe de limpeza, na ocasião o Diretor da  geRHação Sr. Hilário Frainer apresentou uma palestra sobre temperamento,  também foi repassado aos colaboradores a Visão, Missão e Valores da  geRHação, efetuada a distribuição de brindes e homenageados os  aniversariantes do periodo.</div>', '2010-06-23 19:21:48', 1, 0, '0000-00-00 00:00:00', NULL, 4, 0, 0, 43, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(49, 0, 'Treinamento Seara - Itajaí 17/06/2010', '', 'treinamento-seara-itaja-17-06-2010', '', '', 'left', 'No dia 17 de Junho de  2010 foi realizado na Seara em Itajaí - SC o Treinamento  Técnico Motivacional, na ocasião o Supervisor  da geRHação Sr. Eder  Juliano Machado apresentou uma palestra  motivacional, também foi  repassado aos colaboradores a Visão, Missão e  Valores da geRHação.', '2010-06-23 19:37:23', 1, 0, '0000-00-00 00:00:00', NULL, 3, 0, 0, 38, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;'),
(50, 0, 'Treinamento técnico/motivacional Equipe Joinville', '', 'treinamento-tcnico-motivacional-equipe-joinville', '', '', 'left', '<div style="text-align: justify;">No dia 26 de Junho de 2010 foi realizado na Sede da geRHação em Joinville -  SC o Treinamento Técnico Motivacional, para a equipe de Joinville, na ocasião  o Supervisor da geRHação Sr. Eder Juliano Machado apresentou uma palestra  motivacional, também foi repassado aos colaboradores a Visão, Missão e Valores  da geRHação e homenageados os aniversáriantes do periodo.</div>', '2010-06-29 11:36:01', 1, 0, '0000-00-00 00:00:00', NULL, 1, 0, 0, 11, 'accessuserid=0,;uploaduserid=-2,;deleteuserid=-2,;zoom=2;');
